import classes from './CarInfo.module.css';

const CarInfo = (props) => {
  const infoForCar = props.carsInfo.map((cars) => {
    return cars.map((car) => {
      if (car.id === props.loadCarInfo) {
        return (
          <ul key={car.id}>
            <li>brand:<p>{car.brand}</p></li>
            <li>series:<p>{car.series}</p></li>
            <li>model:<p>{car.model}</p></li>
            <li>year:<p>{car.year}</p></li>
            <li>engine:<p>{car.engine}</p></li>
            <li>mileage:<p>{car.mileage}</p></li>
          </ul>
        );
      }
    });
  });

  return <div className={classes['car-info']}>{infoForCar}</div>;
};

export default CarInfo;
